import React from "react";
import circleLogo from "../images/circleLogo.png";
import students3 from "../images/circleLogo.png";

const SplashScreen = () => {
  return (
    <>
      <img src={circleLogo} alt="LearnHyve Logo" id="circleLogo" />
    </>
  );
};

export default SplashScreen;
